// SPDX-License-Identifier: MIT

// This contract will allow you to setup your user account to either be an uploader and downloadedr and cloud storage user (NRO user), service provider for storage, cloud or both (AWS)
// Users should belong to an organization. * Can implement different coins to allow you to authenticate to a group. * Service providers do not need to belong to an organization for now
// Authentication should be occuring throughout. Once your account is established correctly you should only be able to click the link for the page you will be allowed to use.
// There will be different contracts once you enter a link. 

pragma solidity >=0.6.0 <0.9.0;
import "@openzeppelin/contracts/access/Ownable.sol";

contract DetermineUser is Ownable{

    address[] _privateKeyNRO; address[] _privateKeyNSA; address[] _privateKeyCIA; address[] _privateKeyAWS;
    constructor(address[] memory privateKeyNRO,address[] memory privateKeyCIA,address[] memory privateKeyNSA,address[] memory privateKeyAWS) { // extend this for user type and orgname, should be a list of numbers

        _privateKeyNRO = privateKeyNRO;
        _privateKeyNSA = privateKeyNSA;
        _privateKeyCIA = privateKeyCIA;
        _privateKeyAWS = privateKeyAWS;
    }

    enum OrgName{ None, NRO, NSA, CIA, AWS }
    OrgName _orgName;

    enum UserType{ None, User,ProviderStorage, ProviderCloud, ProviderBoth}
    UserType _userType;

    struct People {
        string name;
        UserType yourUserType;
        OrgName organization;
    }

    People[] public people;
    mapping(string => UserType) public nameToUserType;
    mapping(string => OrgName) public nameToOrganization;
    mapping(OrgName => address[]) public orgnameToKey;

    function createMapping() public onlyOwner{ //must be called in order for contract to run
        orgnameToKey[OrgName.NRO]= _privateKeyNRO;
        orgnameToKey[OrgName.NSA]= _privateKeyNSA;
        orgnameToKey[OrgName.CIA]= _privateKeyCIA;
        orgnameToKey[OrgName.AWS]= _privateKeyAWS;

    }

    // if owner wants to change private keys after contract is deployed
    function changePrivateKeys(address[] memory _newprivateKeyNRO,address[] memory _newprivateKeyCIA,address[] memory _newprivateKeyNSA,address[] memory _newprivateKeyAWS) public onlyOwner{ //input should be a new list of numbers
        _privateKeyNRO=_newprivateKeyNRO;
        _privateKeyNSA=_newprivateKeyNSA;
        _privateKeyCIA=_newprivateKeyCIA;
        _privateKeyAWS=_newprivateKeyAWS;
        createMapping();
    }



    function checkOrgList(address usersPrivateKey,  OrgName selectionNumOrg) public view returns(bool){//checks if number is in list and list is based on organization chosen
        bool result;
        result= false;
        if (selectionNumOrg==OrgName.None) {result=true;}
        //wont go through the loop anyway if orgname is none
        for (uint j = 0; j < orgnameToKey[selectionNumOrg].length; j++) {
            if (orgnameToKey[selectionNumOrg][j]==usersPrivateKey){result=true;break;} else {result=false;} 
        }
        return result;

    }
    function checkTypeList(OrgName selectionNumOrg, UserType selectionNumType) public pure returns(bool){ // ensure that only certain organizations can be determined as a specific type etc.
        bool result;
        result= false;

        if ((selectionNumOrg==OrgName.NRO || selectionNumOrg==OrgName.NSA || selectionNumOrg==OrgName.CIA) && selectionNumType==UserType.User){result=true;
        } else if (selectionNumOrg==OrgName.AWS && selectionNumType==UserType.ProviderBoth) {result=true;
        } else if (selectionNumOrg==OrgName.None && (selectionNumType==UserType.ProviderCloud || selectionNumType==UserType.ProviderStorage || selectionNumType==UserType.None)){result=true;
        } else {result=false;}

        return result;

    }
     // modifier to check whether your private key has authorization to a specific user type. 


    modifier onlyCertainKeys(address usersPrivateKey, UserType selectionNumType, OrgName selectionNumOrg) { 

        require(checkOrgList(usersPrivateKey, selectionNumOrg), 'You cant do this');
        require(checkTypeList(selectionNumOrg, selectionNumType), 'You cant do this');
        _;

    }

    function people_list() public view returns (address[] memory) { //A list of users
        return _privateKeyNRO;
    }

    // add a person to an organization and determine the type of user.
    function addPerson( string memory _name,  UserType selectionNumType, OrgName selectionNumOrg) public onlyCertainKeys(msg.sender, selectionNumType, selectionNumOrg) {
        // Check whether user is authorized to the organization and user type by using their private key and authenticating in the two seperate functions

        people.push(People( _name, selectionNumType, selectionNumOrg));
        nameToOrganization[_name]= _orgName;
        nameToUserType[_name]= _userType;
    }


    // only owner can authenticate a key because the contract deployment process and the changePrivateKeys function
    // if i implement an automatic payment to user type in here than the same owner would have to be for both contracts and i would have to increase allowance everytime someone is added anyway.



}
